import React from 'react'
// import Col from 'react-bootstrap/Col'
import { useDispatch } from 'react-redux'

export default function Cell(props) {
    let className = "col"
    function addLifeStatus() {
        if (props.life === 1) {
            className += ' alive'
        } else {
            className += ' dead'
        }
    }
    addLifeStatus();

    return (
        <div className={className}></div>
    )
}
